document.addEventListener('DOMContentLoaded', function () {
  chrome.storage.local.get(['dailyBite'], function (result) {
    var dailyBite = result.dailyBite;
    if (dailyBite) {
      var contentDiv = document.getElementById('content');
      var supportDiv = document.getElementById('support');
      contentDiv.innerHTML = "<strong>CSS Property:</strong> ".concat(dailyBite.property);
      supportDiv.innerHTML = "<strong>Browser Support:</strong> <pre>".concat(JSON.stringify(dailyBite.support, null, 2), "</pre>");
    } else {
      document.getElementById('content').innerText = 'No daily bite available. Please try again tomorrow!';
    }
  });
});
